import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.css'
import App from './components/App';
import { BrowserRouter as Router, Switch, Route,Redirect,Link} from "react-router-dom";
import * as serviceWorker from './serviceWorker';

ReactDOM.render(

    <Router>
                <Switch>
                    <Route path="/" component={App} exact />
                    <Route path="ServiceProviderHome" component={ServiceProviderHome}/>
                    <Route path="PatientHome">
                        <Mrc />
                    </Route>
                    <Route path="UploadEmr" component={UploadEmr} />
                    <Route path= "showPatientMrc">
                    <br></br>
                        <a href="/UploadEmr" style={{padding:"40px"}}>
                            <img src={IconUpload} width="50px" height="50px" class="d-inline-block align-top" alt="" />
                            <b>Add a new EMR</b>
                        </a>
                      <Mrc account={this.state.permissionAccount} />
                    </Route>
                  </Switch> 

    </Router>
    ,document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
